css:
@-moz-document domain("okcupid.com") {
 


#page{
background-color:#000000!important;}

#main_content{
background-color:#000000 !important;}

body.shell, #body_wrapper, body#p_match #main_content h1 {
background-color:#000000 !important;}

div.tabbed_heading, form.styled div.form_section, form.styled div.form_contents{
background-color:#111111!important;background-image:none!important}

div.user_row div.expander, div.conversation_row, ul#messages li{
background-color:#111111!important;}

div.user_row, div#main_column div.stalkers div.stalker p.match_percentages {
background-color:#000000!important;}

.photobrowser{
background-color:#222222!important;}

.photobrowser  .item, div.big_dig div.questions div.question{
background-color:#000000!important;}

#header, div#pro_match_results h2, li.pro_unfound{
background-color:#000000!important;}

#wrapper, div.wrap, div.match_row, div.contact_notices, form.styled, div.big_dig div.right ul li {
background-color:#000000!important;}

body.shell, #body_wrapper, div#right_bar div.body, #visitor_stats p {
background-color:#000000!important;}

div.content_footer_wrapper .complete_your_profile p{
background-color:#111111!important;}

.oknotice, .oknotice_success, .oknotice_error{
background-color:#000000!important;}

.im_tab, .event_cap, #event_display_body div.event p{
background-color:#111111!important;}

#event_display_body div.event {
background-color:#222222!important;}

.im_to_me{
color:#c96060 !important;}

.im_from_me{
color:#555888 !important;}

.im_from_me.archive{
color:#555555 !important;}

div.im_text{
background-color:#000000 !important;}

div.tabbed_heading div#percentages{
background-color:#111111 !important;}

div.inline_notes{
background-color:#111111 !important;}

div.okad div.frame{
background-color:#000000!important;}

}
